<script setup>
import * as echarts from 'echarts';
const initChart = () => {
  const myChart = echarts.init(document.getElementById('main'));



  var  colorList=['#FFCC66', '#267DFF', '#3feed4', '#3bafff', '#f1bb4c', "rgba(250,250,250,1)"];


  const  placeHolderStyle = {
    normal: {
      label: {
        show: false
      },
      labelLine: {
        show: false
      },
      color: 'rgba(0, 0, 0, 0)',
      borderColor: 'rgba(0, 0, 0, 0)',
      borderWidth: 0
    }
  };

  let data = [];


      [
        {value:28, name:'校级数',},
        {value:14, name:'院级数'},
      ].map((item,index)=>{
        data.push({
          name:item.name,
          value:item.value,
          // itemStyle:{
          //   normal:{
          //     color:colorList[index % colorList.length]
          //   }
          // },
          label: {
            normal: {
              position: 'inner',
              formatter: '{b}',

              textStyle: {
                color: '#fff',
                fontWeight: 'bold',
                fontSize: 14
              }
            }
          },
        });
        data.push({
          name:`${item.name}1`,
          value:0.5,
          itemStyle:placeHolderStyle,
          label:{
            show:false
          }
        });
  });



  const legendData = [
    {value:28, name:'校级数',},
    {value:14, name:'院级数'},
  ].map((item,index)=>{
    return {
      name :item.name,
      itemStyle:{
        color:colorList[index],

      }
    }
  })

  const imageUrl1 =
      'data:image/png;base64,'

  const option = {
    graphic: {
      elements: [
        {
          type: 'image',
          style: {
            image: imageUrl1,
            width: 150,
            height: 150
          },
          left: 'center',
          top: 'center',
          z: 99
        },
      ]
    },
    backgroundColor: '#000000',
    legend: {
      show: true,
      icon: "circle",
      top: "center",
      left: "65%",
      data: legendData,
      orient:'vertical',
      formatter: (name) => {
        return (
            "{title|" + name + "}{value|" + data.find((item) => {
              return item.name == name
            }).value + "}"
        );
      },
      textStyle: {
        rich: {
          title: {
            width: 120,
            color: 'white',
            fontSize:14,
            fontFamily:'MicrosoftYaHei',
            fontWeight:500,
            lineHeight: 19,
            textShadowColor:'rgba(55,121,220,0.6)',
            textShadowOffsetX:0,
            textShadowOffsetY:0,
            textShadowBlur:8,
          },
          value: {
            width: 30,
            align:'right',
            color: 'white',
            fontSize:20,
            lineHeight: 23,
            fontWeight:600,
            fontFamily:'pmzd',
            textShadowColor:'#3A89FE',
            textShadowOffsetX:0,
            textShadowOffsetY:0,
            textShadowBlur:9,
          }
        },
      },
    },
    title: {
      text: '42',
      subtext: '困难总数',
      x: 'center',
      y: 'center',
      textStyle: {
        fontSize:16,
        fontWeight:'normal',
        color: '#FFE066'
      },
      subtextStyle: {
        color: '#FFFFFF',
        fontSize: 12
      },
    },
    grid: {
      bottom: 150,
      left: 0,
      right: '10%'
    },
    series: [
      // 主要展示层的
      {
        radius: [65, 50],
        center: ['50%', '50%'],
        type: 'pie',
        // itemStyle: {
        //   normal: {
        //     color: function(params) {
        //       return colorList[params.dataIndex ]
        //     }
        //   }
        // },
        color: colorList,
        label:{
          show:false
        },
        data: data,
      },
      // 边框的设置
      {
        radius: [60, 50],
        center: ['50%', '50%'],
        type: 'pie',
        animation: false,
        tooltip: {
          show: false
        },
        itemStyle: {
          normal: {
            color:'rgba(0,0,0,0.3)'
          }
        },
        label:{
          show:false
        },
        data: data,
      }
    ]
  };



  myChart.setOption(option);
};

nextTick(async () => {
  initChart();
});
</script>

